import React from 'react';
import AppBar from '@material-ui/core/AppBar';
import {makeStyles} from '@material-ui/core/styles';
import { Toolbar, IconButton, Grid, Typography, Avatar } from '@material-ui/core';
import MenuIcon from '@material-ui/icons/Menu';
import DescriptionRoundedIcon from "@material-ui/icons/DescriptionRounded";
import NotificationsIcon from '@material-ui/icons/Notifications';


import styles from "../styles/AppHeaderStyle";

const useStyles = makeStyles(styles);

function AppHeader() {

  const classes = useStyles();

  return (
    <AppBar color="transparent" style={{boxShadow: 'none'}} >
      <Toolbar>
        <IconButton color="inherit" edge="start">
          <MenuIcon />
        </IconButton>
        <DescriptionRoundedIcon color="primary" className={classes.surveyIcon}/>
        <Typography variant="h6" className={classes.name}>FutureSurvey</Typography>
        <IconButton className="classes.notifIcon" >
          <NotificationsIcon />
        </IconButton>
        <IconButton disableRipple style={{backgroundColor: 'transparent',}}>
          <Avatar className={classes.avatar} >
            D
          </Avatar>
        </IconButton>
      </Toolbar>
    </AppBar>
  );
}

export default AppHeader;
